                <div class=""section-title text-start"">
                    <h4>Introduction to</h4>
                    <h2>food (track and trace)</h2>
                </div>
                <p>Supply chains can be complicated.</p>
                <p>
                    Imagine for a moment that a manufacturer uses the wrong design specs, a supplier mixes up two
                    different orders or a raw material causes a bad batch of products that need to be recalled. On
                    top of that, billions of dollars in cash flow are now tied up while the problem is being
                    rectified plus the 60-day payment terms.
                </p>");
            WriteLiteral(@"
                <p>
                    The effects of poorly managed supply chains continue to trouble businesses today. On May 10th of
                    2016, hoverboards were exploding all over the world. A number of incidents of the boards
                    catching fire led to major retailers such as Amazon and Target issuing refunds and telling
                    customers to trash them. Airlines were banning them and some cities were even banning
                    hoverboards from roads and sidewalks. It is was later found that the batteries in the boards
                    were defective and causing the fires.
                </p>
                <p>
                    VeriDoc Global has developed a supply chain solution that leverages blockchain technology and
                    smart contracts. Our system verifies that each step in the supply chain has registered a
                    “digital handshake” that marks exactly when and where the goods have changed hands. This makes");
            WriteLiteral("\r\n                    it clear who is liable for products every step of the way.\r\n                </p>\r\n            </div>\r\n            <div class=\"col-md-6 text-center\">\r\n                ");
