            <div class=""row align-items-center"">
                <div class=""col-md-8"">
                    <p>
                        The reality is none of us has ever stopped to think whether the food safety standards have
                        been upheld, we don't have the power to see where our food has come from or even if that
                        particular company has followed certified safety standards. Isn't time to take back more of
